import React from "react";
import {
  BrowserRouter as Route,
  Link,
  Router,
  Switch,
  Redirect
} from "react-router-dom";
import "./styles/ContentContainer.css";
import "./styles/Forms.css";
import "./styles/GridLayout.css";
import ContractPage from "../components/Pages/ContractPage";
import ImpressumPage from "./Pages/ImpressumPage";

class ContentContainer extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      title: props.title,
      user: [],
      contracts: [
        {
          name: "Autoversicherung",
          startDate: "02.09.2014",
          endDate: "1.10.2024",
          price: "100€",
          description: "Pro Monat"
        },
        {
          name: "Handyvertrag",
          startDate: "01.01.2018",
          endDate: "01.01.2020",
          price: "34,99€",
          description: "Telekom Handyvertrag pro Monat"
        },
        {
          name: "Krankenversicherung",
          startDate: "01.08.2019",
          endDate: "ohne Laufzeit",
          price: "200€",
          description: "TK"
        }
      ],
      bills: []
    };
  }

  render() {
    return (
      <div>
        <Router>
          <Switch>
            <Route path="/Contracts"></Route>
          </Switch>
        </Router>
        <ContractPage
          title={this.state.title}
          contracts={this.state.contracts}
        />
        <ImpressumPage />
      </div>
    );
  }
}

export default ContentContainer;
